import React , {setState} from 'react';
import PropTypes from 'prop-types';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import { stylesContent } from "../styles/Styles"
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles(() => ({
  div: {
    color: "black",
    fontFamily: "Helvetica",
    fontSize: "40px",
    textAlign: "center",
    position: "absolute",
    top: "50%"
  }


}));

function TestList(props) {
  const classes = useStyles();
  const [hover, sethover] = React.useState(false);

  let linkStyle;
  if (hover) {
    linkStyle = { backgroundColor: 'red' }
  }

  return (

    <Grid container >
      <Grid item xs={6}>
        <Typography component="div" style={{ backgroundColor: '#cfe8fc', height: '100vh' }}>
          <div className={classes.div}>
            Test de niveau
          </div>
        </Typography>
      </Grid>

      <Grid item xs={6}>
        <Typography style={{ backgroundColor: '#f5f5f5', height: '100vh' }}  onMouseOut={() => sethover(false)}>
          <div className={classes.div} style={{linkStyle}} onMouseOver={() => sethover(true)}>
            Test de profile d'apprentissage
          </div>
        </Typography>
      </Grid>

      {/* <TestPage /> */}

    </Grid>

  );
}

TestList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(stylesContent)(TestList);
